    constructor(props) {
        super(props)
        this.state = {
            response:[]
        }


    }
    getData(){
        console.log(this.props.user.sid)
        var url="http://127.0.0.1:8081/v2/room/supplier?sid=s01"
        //url+=this.props.user.sid
        console.log(url)
        Axios.get(url)
            .then(res=>{
                console.log("res:",res.data);
                this.setState({
                    response:res.data
                })


            });   
    }



    render() {
        console.log(this.props.user.sid)
        return (
            <div className = "property">
                <Navibar loggedinstatus={this.props.loggedinstatus} />  
                <div className="property-container">
                    <button className="proper_button" onClick={()=> {this.getData()}}>Manage your property</button>
                    <br />
                    <div>
                        {this.state.reponse.name}
                    </div>


                </div>
            </div>      
        )
    }
}
